import { useEffect, useState } from "react";

function App() {
  const [value, setValue] = useState([]);
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos/1")
      .then((res) => res.json())
      .then((json) => setData([json]));
  }, []);


  return (
    <div className="App">
      <button onClick={() => setValue(data)}> click</button>
      <ul>
        {
          value.map((elem,id) => {
            return <li key={id}>{elem.title}</li>
          })
        }
      </ul>
    </div>
  );
}

export default App;
